import React from 'react';
import Card from './Card'
import data from "./data"
import { useNavigate } from "react-router-dom";
import './cards.css'


function Choice() {

  const navigate = useNavigate();

    const navToHome = () => {
      navigate("/");
  }

  const navToPublic = () => {
    navigate("/public");
}

  function condition(event) {
    for(let i = 0; data.length; i++){
        data[i].push(event)
    }
  }


  return <>
  <div>
  <button onClick={navToHome}className='nav'>Return Home</button>
  <h1 className='nav'>OR</h1>
  <form className='nav' onSubmit={condition}>
    <label className='center'>Search Bar</label>
    <input type="text" name="choice"></input>
    <input type="Submit" onClick={navToPublic}></input>
</form>
</div>

  </>

}

export default Choice;
